  - stampState: paper_stamp-cent
    stampedBy:
    - CentCom
    content: "1. ENSURE THAT  !! ALL !!  CREW IS ONBOARD BEFORE DOING ANYTHING\n \n2. DECIDE THEN STATE YOUR INTENT TO WHOLE CREW USING COMMUNICATIONS COMPUTER\n \n3. EXECUTE THE MANEUVER.\n3.1 IF YOUR INTENTION IS TO CHANGE POSITION OF SPACESHIP INSIDE THE SECTOR BY FLIGHT, REFER TO POINT 4. \n3.2 IF YOUR INTENTION IS TO TRAVEL TO A DIFFERENT SECTOR BY TRAVELLING THROUGH HYPERSPACE USING FTL. FIRST, REQUIRED IS PERMISSION OF CAPTAIN TO PROCEED. ONCE GRANTED, REFER TO POINT 5.\n3.3 IF YOUR INTENTION IS DIFFERENT THAN LISTED. INFORM ALL HEADS AND COMMAND MEMBERS FIRST. THEN GAIN PERMISSION FROM CAPTAIN OR USE YOUR OWN DISGRESSION IF ITS EMERGENCY. WE WARNED, YOU WILL BE HELD ACCOUNTABLE FOR YOUR ACTIONS.\n \n4. FLIGHT IS YOUR INTENTION. BE IT REPOSITIONING IN SPACE OR ROTATING. THIS SECTION COVERS IT.\n4.1 IF REPOSITIONING IS DESIRED. ENGAGE GYROSCOPES(ROTATION) FIRST BEFORE ENGAGING THRUSTERS(MOVEMENT). DUE TO THE SIZE OF THE VESSEL, IT IS UTILISING GYROSCOPES AS AID FOR ACCELERATION. IF THIS PROCEDURE IS SKIPPED. SPACESHIP WILL FLY AT SNAIL'S PACE.\n4.2 BEGIN THE MANEUVER TO DESIRED LOCATION AND ROTATION.\n4.3 ENSURE THAT YOU DON'T COLLIDE WITH ANY CELESTIAL BODIES OR VESSELS.\n4.4 IF ALLIED OR OWNED VESSELS ARE ATTEMPTING DOCKING PROCEDURES DURING YOUR MANEUVER, INCREASED CAUTION IS ADVISED AND IF NEEDED, DENY SUCH VESSELS DOCKING RIGHTS TILL YOUR MANEUVER IS COMPLETED.\n4.5 ONCE SPACESHIP ARRIVES TO DESIRED LOCATION AND ROTATION. ENSURE THAT IT IS BROUGHT TO A FULL HALT IN ORDER TO AVOID IT DRIFTING AWAY\n4.6 ANNOUCE TO WHOLE CREW THAT THE MANEUVER IS COMPLETE AND IT'S SAFE TO RESUME EVA ACTIVITIES.\n4.7 CAUTIOUSLY STEP AWAY FROM CONSOLE WHILE AVOIDING ACCIDENTALLY KNOCKING THE CONTROLS.\n4.7 ADDENDUM. IF CONTROLS WERE ACCIDENTALLY KNOCKED. DECLARE EMERGENCY THROUGH COMMUNICATIONS CONSOLE AND ACCESS CAUSED DAMAGES AND LOSS OF CREW.\n \n5. FTL IS YOUR INTENTION. WHICH MEANS CHANGING SECTOR. EITHER TO UNDISCOVERED ONE OR PREVIOUSLY VISITED. THIS SECTION COVERS IT.\n"
